def countCornerRectangles(grid):
	if not grid: return 0
	if len(grid)<=1 or len(grid[0])<=1: return 0

	count = 0
	res = 0
	for i in range(len(grid)):
		for j in range(i+1,len(grid)):
			count = 0
			for n in range(len(grid[0])):
				if grid[i][n] == 1 and grid[j][n]==1:
					count +=1
			if count >0:
				res += count * (count -1)/2
	return res 

